import React from 'react'
import Character from 'Character'

export default function CharacterHolder(props){
  let orderedChars = props.sort((a,b) => {a.initiative > b.initiative || a.dex > b.dex }).map((char) => <Character props={char}/>)
  return(
    <div>
      {orderedChars}
    </div>
  )
}
